import { SET_LOGIN, SET_LOGOUT, SET_SIGNUP } from "./authTypes"
const setLogin = () => {
    return {
        type : SET_LOGIN
    }   
}
const setLogout = () => {
    return {
       type : SET_LOGOUT
    }  
}
const setSignUp = () => {
    return {
        type : SET_SIGNUP
    }
}
const setSignOut = () => {
    return {
        type : SET_SIGN
    }
}

export {
    setLogin,
    setLogout,
    setSignUp
}
